// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IERC721 {
  function ownerOf(uint256 tokenId) external view returns (address);
  function safeTransferFrom(address from, address to, uint256 tokenId) external;
  function isApprovedForAll(address owner, address operator) external view returns (bool);
  function getApproved(uint256 tokenId) external view returns (address);
  function setApprovalForAll(address operator, bool approved) external;
}

abstract contract ReentrancyGuard {
  uint256 private constant _NOT_ENTERED = 1;
  uint256 private constant _ENTERED = 2;
  uint256 private _status = _NOT_ENTERED;
  modifier nonReentrant() {
    require(_status != _ENTERED, "REENTRANCY");
    _status = _ENTERED; _;
    _status = _NOT_ENTERED;
  }
}

contract ZombieMarket is ReentrancyGuard {
  struct Listing {
    address nft;          // ERC721 contract
    uint96  price;        // in wei
    address seller;       // lister
  }

  mapping(bytes32 => Listing) public listings;
  mapping(address => uint256) public proceeds; // seller â†’ ETH they can withdraw

  address public owner;
  uint96  public feeBps;      // e.g., 250 = 2.5%
  address public feeRecipient;

  event Listed(address indexed nft, uint256 indexed tokenId, address indexed seller, uint96 price);
  event PriceUpdated(address indexed nft, uint256 indexed tokenId, uint96 newPrice);
  event Cancelled(address indexed nft, uint256 indexed tokenId, address indexed seller);
  event Purchased(address indexed nft, uint256 indexed tokenId, address indexed buyer, uint96 price);
  event Withdrawn(address indexed user, uint256 amount);

  modifier onlyOwner() { require(msg.sender == owner, "NOT_OWNER"); _; }

  constructor(uint96 _feeBps, address _feeRecipient) {
    owner = msg.sender;
    feeBps = _feeBps;                 // set 250 for 2.5%
    feeRecipient = _feeRecipient;     // can be owner initially
  }

  function setFee(uint96 _feeBps, address _feeRecipient) external onlyOwner {
    require(_feeBps <= 1000, "FEE_TOO_HIGH"); // max 10%
    feeBps = _feeBps;
    feeRecipient = _feeRecipient;
  }

  function _key(address nft, uint256 tokenId) internal pure returns (bytes32) {
    return keccak256(abi.encodePacked(nft, tokenId));
  }

  function list(address nft, uint256 tokenId, uint96 price) external nonReentrant {
    require(price > 0, "PRICE_ZERO");
    IERC721 c = IERC721(nft);
    require(c.ownerOf(tokenId) == msg.sender, "NOT_OWNER");
    require(
      c.getApproved(tokenId) == address(this) || c.isApprovedForAll(msg.sender, address(this)),
      "MARKET_NOT_APPROVED"
    );

    bytes32 k = _key(nft, tokenId);
    listings[k] = Listing({ nft: nft, price: price, seller: msg.sender });
    emit Listed(nft, tokenId, msg.sender, price);
  }

  function updatePrice(address nft, uint256 tokenId, uint96 newPrice) external {
    bytes32 k = _key(nft, tokenId);
    Listing storage L = listings[k];
    require(L.seller == msg.sender, "NOT_SELLER");
    require(newPrice > 0, "PRICE_ZERO");
    L.price = newPrice;
    emit PriceUpdated(nft, tokenId, newPrice);
  }

  function cancel(address nft, uint256 tokenId) external {
    bytes32 k = _key(nft, tokenId);
    Listing memory L = listings[k];
    require(L.seller == msg.sender, "NOT_SELLER");
    delete listings[k];
    emit Cancelled(nft, tokenId, msg.sender);
  }

  function buy(address nft, uint256 tokenId) external payable nonReentrant {
    bytes32 k = _key(nft, tokenId);
    Listing memory L = listings[k];
    require(L.price > 0, "NOT_LISTED");
    require(msg.value == L.price, "BAD_PRICE");

    // fee + seller proceeds
    uint256 fee = (uint256(L.price) * feeBps) / 10_000;
    uint256 sellerAmt = uint256(L.price) - fee;
    proceeds[L.seller] += sellerAmt;
    if (fee > 0) proceeds[feeRecipient] += fee;

    // transfer NFT
    IERC721(L.nft).safeTransferFrom(L.seller, msg.sender, tokenId);

    delete listings[k];
    emit Purchased(nft, tokenId, msg.sender, L.price);
  }

  function withdraw() external nonReentrant {
    uint256 amount = proceeds[msg.sender];
    require(amount > 0, "NOTHING");
    proceeds[msg.sender] = 0;
    (bool ok, ) = payable(msg.sender).call{value: amount}("");
    require(ok, "WITHDRAW_FAIL");
    emit Withdrawn(msg.sender, amount);
  }
}
